/*Table structure for table `dts_txnhistory` */

DROP TABLE IF EXISTS `dts_txnhistory`;

CREATE TABLE `dts_txnhistory` (
  `objid` int(11) NOT NULL AUTO_INCREMENT,
  `ref` varchar(20) DEFAULT NULL,
  `date` varchar(50) DEFAULT NULL,
  `docno` varchar(20) DEFAULT NULL,
  `actions` varchar(10) DEFAULT NULL,
  `username` varchar(200) DEFAULT NULL,
  `activity` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`objid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `dts_txnhistory` */

/*Table structure for table `notes` */

DROP TABLE IF EXISTS `notes`;

CREATE TABLE `notes` (
  `noteid` int(10) NOT NULL AUTO_INCREMENT,
  `title` varchar(50) DEFAULT NULL,
  `content` longtext DEFAULT NULL,
  `date` date DEFAULT NULL,
  `user_id` int(10) DEFAULT NULL,
  PRIMARY KEY (`noteid`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `notes` */

/*Table structure for table `ordinances` */

DROP TABLE IF EXISTS `ordinances`;

CREATE TABLE `ordinances` (
  `OrdinanceNumber` varchar(30) NOT NULL,
  `OrdinanceTitle` longtext DEFAULT NULL,
  `DatePHearing` date DEFAULT NULL,
  `DateEnacted` date DEFAULT NULL,
  `DateLCE` date DEFAULT NULL,
  `DateProvince` date DEFAULT NULL,
  `DateAdded` date DEFAULT NULL,
  `Author` varchar(30) DEFAULT NULL,
  `CoAuthor` longtext DEFAULT NULL,
  `Category` varchar(30) DEFAULT NULL,
  `Filenames` longtext DEFAULT NULL,
  PRIMARY KEY (`OrdinanceNumber`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `ordinances` */

/*Table structure for table `pdf` */

DROP TABLE IF EXISTS `pdf`;

CREATE TABLE `pdf` (
  `pdfno` varchar(10) NOT NULL,
