  `length` int(11) NOT NULL,
  PRIMARY KEY (`pdfno`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `pdf` */

/*Table structure for table `positionlist` */

DROP TABLE IF EXISTS `positionlist`;

CREATE TABLE `positionlist` (
  `objid` int(10) NOT NULL AUTO_INCREMENT,
  `codeID` varchar(70) NOT NULL,
  `position` varchar(70) NOT NULL,
  `description` varchar(70) NOT NULL,
  PRIMARY KEY (`objid`,`codeID`),
  UNIQUE KEY `obid` (`objid`)
) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=latin1;

/*Data for the table `positionlist` */

/*Table structure for table `resolutions` */

