  `Category` varchar(30) DEFAULT NULL,
  `Filenames` longtext DEFAULT NULL,
  PRIMARY KEY (`ResolutionNumber`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `resolutions` */

